import React from 'react';
import './App.css';

import './heading/Heading.js';

function App() {
  return (
    <div className="App">
      <Heading></Heading>
      <section className="experience">
        <div className="experience-project">
          <img src="http://placekitten.com/g/200/300" alt="placeholder"></img>
          <p>Star Wars coding kit at Kano Computing</p>
        </div>
        <div className="experience-detail">
          <p>ask me how I created a lightsaber with <span>pixi.js</span> and <span>Polymer.js</span></p>
        </div>
      </section>
      <section className="fun">
        <h2>Fun things</h2>
        <div className="fun-example">
          <img src="http://placekitten.com/g/200/300" alt="placeholder"></img>
          <p>tiny rocket game</p>
        </div>
      </section>
      <section className="contact">
          <h2>Get in touch</h2>
      </section>
    </div>
  );
}

export default App;
